import React from 'react';
import { useDispatch } from 'react-redux';
import Link from 'next/link';
import { Button, Form, Input, Checkbox } from 'antd';
import { loginRequestAction } from '../reducers/user';

const layout = {
  labelCol: { span: 8 },
  wrapperCol: { span: 16 },
};
const tailLayout = {
  wrapperCol: { offset: 8, span: 16 },
};

const LoginForm = () => {
  const dispatch = useDispatch();

  const onFinish = (values) => {
    console.log('Success:', values);
    dispatch(loginRequestAction({
      id: values.id,
      password: values.password,
    }));
  };

  const onFinishFailed = (errorInfo) => {
    console.log('Failed:', errorInfo);
  };

  return (
    <>
      <div style={{ backgroundColor: 'white', width: '500px', height: '230px', paddingTop: '50px', paddingRight: '70px' }}>
        <Form {...layout} name="basic" initialValues={{ remember: true }} onFinish={onFinish} onFinishFailed={onFinishFailed}>
          <Form.Item label="Username" name="username" rules={[{ required: true, message: 'Please input your username!' }]}>
            <Input />
          </Form.Item>
          <Form.Item label="Password" name="password" rules={[{ required: true, message: 'Please input your password!' }]}>
            <Input.Password />
          </Form.Item>
          <Form.Item {...tailLayout} name="remember" valuePropName="checked" style={{ marginTop: '-15px' }}>
            <Checkbox>Remember me</Checkbox>
          </Form.Item>
          <Form.Item {...tailLayout}>
            <Button type="primary" htmlType="submit" ghost style={{ marginRight: '10px', marginTop: '-15px' }}>로그인</Button>
            <Button type="primary" htmlType="button" ghost style={{}}><Link href="/join"><a>회원가입</a></Link></Button>
          </Form.Item>
        </Form>
      </div>
    </>
  );
};

export default LoginForm;
